// src/components/Navbar.js

import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Navbar.css'; // Import the CSS file

const Navbar = () => {
  const navigate = useNavigate();

  const handleHomeClick = () => {
    // Handle the home link click behavior.
    navigate('/');
  };

  const handleProjectsClick = () => {
    // Handle the projects button click behavior.
    navigate('/projects');
  };

  const handleCertificationsClick = () => {
    // Handle the certifications button click behavior.
    navigate('/certifications');
  };

  return (
    <div className="navbar">
      {/* Left Side (Name) */}
      <div className="name-link" onClick={handleHomeClick}>
        Dhruv
      </div>

      {/* Right Side (On-page Navigations) */}
      <div className="nav-links">
        <button className="button-style" onClick={handleProjectsClick}>
          Projects
        </button>
        <button className="button-style" onClick={handleCertificationsClick}>
          Certifications
        </button>
      </div>
    </div>
  );
};

export default Navbar;
